import React from "react";

const Login = () => {
  return (
    <div class="ml-64">
      <div class="mb-6 flex justify-center">
        <label
          for="small-input"
          class="block mb-2 text-sm font-medium text-gray-900"
        >
          Small input
        </label>
        <input
          type="text"
          id="small-input"
          class="block w-1/2 p-2 text-gray-900 border border-gray-300 rounded-lg bg-gray-50 sm:w-32 sm:p-1 sm:text-xs focus:ring-blue-500 focus:border-blue-500"
        ></input>
      </div>
    </div>
  );
};

export default Login;
